import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import './styles.scss';

export default class GearSlide extends Component {
    render() {
        return (
            <div className="container-fluid p-0" id="gear-slide">
                <div className="container">
                    <div className="col-12 caption-title text-center">
                        <h1>EXPLORE #AORUS</h1>
                        <p>
                            Discover PC builds inspiration, DIY tips, gaming tricks, worldwide AORUS events, and more.
                        </p>
                        <Link to="/">GET STARTED <i class="fal fa-chevron-right"></i></Link>
                    </div>
                </div>
            </div>
        )
    }
}
